import { JSX, useMemo } from "react";

export interface IconProps {
  children?: JSX.Element | Array<JSX.Element> | null;
  size?: "xs" | "sm" | "md" | "lg" | "xl" | "custom";
  stroke?: string;
  strokeWidth?: number;
  fill?: string;
  className?: string;
  viewBox?: string;
  height?: number;
  width?: number;
}

export type Icon = (props?: IconProps) => JSX.Element;

const BaseIcon = (props: IconProps) => {
  const {
    children,
    size = "md",
    fill = "currentColor",
    stroke,
    strokeWidth,
    className = "",
    viewBox = "0 0 24 24",
    height,
    width,
  } = props;
  const sizeClass = useMemo(() => {
    switch (size) {
      case "xs":
        return "w-4 h-4";
      case "sm":
        return "w-5 h-5";
      case "lg":
        return "w-7 h-7";
      case "xl":
        return "w-10 h-10";
      case "custom":
        return "";
      default:
        return "w-5 h-5";
    }
  }, [size]);

  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox={viewBox}
      height={height}
      width={width}
      fill={fill}
      stroke={stroke}
      strokeWidth={strokeWidth}
      className={`${sizeClass} ${className}`}
    >
      {children}
    </svg>
  );
};

